import React from 'react'

function Create() {
  return (
	<div className='Create'>
		form
		<label htmlFor="">Yangi kino qo'shish</label>
		<input type="text" placeholder='Movie name'/>
		<input type="number" placeholder='Rating'/>
		<button>Add</button>
	</div>
  )
}

export default Create
